import React, { useEffect, useState } from 'react';
import { motion } from 'framer-motion';

const Page3 = () => {
  const [showPhotos, setShowPhotos] = useState(false);

  useEffect(() => {
    const t = window.setTimeout(() => setShowPhotos(true), 1200);
    return () => window.clearTimeout(t);
  }, []);

  const images = [
    '/images/178ad021-9848-4178-8bd6-78b4b4a2ad2d.jpg',
    '/images/1b089b47-1dfc-4fd8-9a2e-c8f51c110e2c.jpg',
    '/images/369bd509-b0ab-4a39-a53d-3484666d5aad.jpg',
    '/images/62def098-7c1a-427a-a88a-27c6e9af7cba.jpg',
    '/images/757bf1b6-d286-4fce-8212-471f033f79a8.jpg',
    '/images/9be7576f-1aa7-4c70-84d1-71667d2005b4.jpg',
    '/images/a34a3f96-a5cb-4659-a868-cc92c2ae5f9a.jpg',
    '/images/cf3df111-7637-4e8e-9561-0276cda7355f.jpg',
    '/images/d071059b-1f9b-441c-adbd-3614b27816f8.jpg',
    '/images/ffed03c9-945e-4ae0-a5d7-2789c05eb33e.jpg',
  ];

  const moments = {
    2: "This still makes me smile.",
    5: "I remember this.",
    8: "This feels like us.",
  };

  return (
    <div className="w-full min-h-screen bg-gradient-to-br from-pink-200 via-rose-100 to-pink-200">
      <div className="max-w-xl mx-auto px-4 pt-14 pb-24">
        <motion.div
          initial={{ opacity: 0, y: 8 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.9, ease: 'easeOut' }}
          className="text-center"
        >
          <div
            className="text-2xl sm:text-3xl font-semibold text-gray-800"
            style={{ fontFamily: "'Kalam', 'Permanent Marker', 'Caveat', cursive" }}
          >
            Here’s how far we’ve come.
            <br />
            Our first Valentine together.
          </div>
        </motion.div>

        <div className="mt-10 space-y-8">
          {showPhotos &&
            images.map((src, idx) => (
              <React.Fragment key={src}>
                <motion.div
                  initial={{ opacity: 0, scale: 0.98, y: 10 }}
                  whileInView={{ opacity: 1, scale: 1, y: 0 }}
                  viewport={{ once: true, amount: 0.35 }}
                  transition={{ duration: 0.7, ease: 'easeOut' }}
                  className="w-full"
                >
                  <div className="w-full overflow-hidden rounded-3xl shadow-xl bg-white/60">
                    <img
                      src={src}
                      alt={`Memory ${idx + 1}`}
                      className="w-full h-auto block"
                      loading="lazy"
                      decoding="async"
                    />
                  </div>
                </motion.div>

                {moments[idx] && (
                  <motion.div
                    initial={{ opacity: 0, y: 6 }}
                    whileInView={{ opacity: 1, y: 0 }}
                    viewport={{ once: true, amount: 0.6 }}
                    transition={{ duration: 0.6, ease: 'easeOut' }}
                    className="text-center"
                  >
                    <div
                      className="text-sm sm:text-base text-gray-700"
                      style={{ fontFamily: "'Kalam', 'Permanent Marker', 'Caveat', cursive" }}
                    >
                      {moments[idx]}
                    </div>
                  </motion.div>
                )}
              </React.Fragment>
            ))}
        </div>

        <motion.div
          initial={{ opacity: 0, y: 8 }}
          whileInView={{ opacity: 1, y: 0 }}
          viewport={{ once: true, amount: 0.7 }}
          transition={{ duration: 0.9, ease: 'easeOut' }}
          className="text-center mt-14"
        >
          <div
            className="text-xl sm:text-2xl font-semibold text-gray-800"
            style={{ fontFamily: "'Kalam', 'Permanent Marker', 'Caveat', cursive" }}
          >
            I’m really happy this is our first Valentine.
          </div>
        </motion.div>

        <div className="h-24" />
      </div>
    </div>
  );
};

export default Page3;
